'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne thing I’ve learned,” I told Jai, “is that when parents tell children things, it doesn’t hurt to get some external validation. If I can get an audience to laugh and clap at the right time, maybe that would add gravitas to what I’m telling the kids.”\n\nJune 30, 2015\n\u001c12\n\u0011\n\u0011\n\n\n4 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c24\n\u0011\n\u0011\n\n\n7 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you see yourself doing something badly and nobody’s bothering to tell you anymore, that’s a bad place to be. You may not want to hear it, but your critics are often the ones telling you they still love you and care about you, and want to make you better.\n\nJuly 1, 2015\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCoach Graham worked in a no-coddling zone. Self-esteem? He knew there was really only one way to teach kids how to develop it: You give them something they can’t do, they work hard until they find they can do it, and you just keep repeating the process. When Coach Graham first got hold of me, I was this wimpy kid with no skills, no physical strength, and no\n\nJuly 1, 2015\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthese days, a guy like Coach Graham might get thrown out of a youth sports league. He’d be too tough. Parents would complain. I remember one game when our team was playing terribly. At halftime, in our rush for water, we almost knocked over the water bucket. Coach Graham was livid: “Jeez! That’s the most I’ve seen you boys move since this game started!” We were eleven years old, just standing there, afraid he’d pick us up one by one and break us with his bare hands. “Water?” he barked. “You boys want water?” He lifted the bucket and dumped all the water on the ground.\n\nJuly 1, 2015\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI haven’t seen Coach Graham since I was a teen, but he just keeps showing up in my head, forcing me to work harder whenever I feel like quitting, forcing me to be better. He gave me a feedback loop for life.\n\nJuly 1, 2015\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe second kind of head fake is the really important one—the one that teaches people things they don’t realize they’re learning until well into the process. If you’re a head-fake specialist, your hidden objective is to get them to learn something you want them to learn. This kind of head-fake learning is absolutely vital. And Coach Graham was the master.\n\nJuly 1, 2015\n\u001c34\n\u0011\n\u0011\n\n\n9 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c38\n\u0011\n\u0011\n\n\n14 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne day Andy took me for a walk. He put his arm around my shoulders and said, “Randy, it’s such a shame that people perceive you as being so arrogant, because it’s going to limit what you’re going to be able to accomplish in life.” Looking back, his wording was so perfect. He was actually saying, “Randy, you’re being a jerk.” But he said it in a way that made me open to his criticisms, to listening to my hero telling me something I needed to hear. There is an old expression, “a Dutch uncle,” which refers to a person who gives you honest feedback. Few people bother doing that nowadays, so the expression has started to feel outdated, even obscure. (And the best part is that Andy really is Dutch.)\n\nThis would be a good project to tag to Grow.\n\nJuly 1, 2015\n\u001c55\n\u0011\n\u0011\n\n\n15 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAfter I die, I want them to take my kids for weekends here and there, and just do stuff. Anything fun they can think of. They don’t have to do the exact things we did together. They can let my kids take the lead. Dylan likes dinosaurs. Maybe Chris and Laura can take him to a natural history museum. Logan likes sports: maybe they can take him to see the Steelers. And Chloe loves to dance. They’ll figure something out.\n\nJuly 1, 2015\n\u001c57\n\u0011\n\u0011\n\n\n16 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA friend once asked me: “What kind of woman do you think would be impressed if you brought her back to this place?” I replied: “The right kind.”\n\nJuly 1, 2015\n\u001c59\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1Z4CsBfl9zx_SmEYONm7I_DIU70OK34cn5iudPm0","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"108WXuM8UbuEQ0LeS4DhzW-0M4eOLO28YzN-39qI","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":23.333333333333332,"i_rot":0.0,"i_clst":{"cv"