:false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4016,"ei":4029,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4030,"ei":4035,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunk = [{"ty":"is","ibi":4036,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c63\n\u0011\n\u0011\n\n\n23 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTime must be explicitly managed, like money\n\nJuly 1, 2015\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can always change your plan, but only if you have one.\n\nThis is what AI could help with\n\nJuly 1, 2015\n\u001c84\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most useful to-do list breaks tasks into small steps.\n\nJuly 1, 2015\n\u001c84\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAsk yourself: Are you spending your time on the right things?\n\nJuly 1, 2015\n\u001c84\n\u0011\n\u0011\n\n\n24 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI T IS an accepted cliché in education that the number one goal of teachers should be to help students learn how to learn. I always saw the value in that, sure. But in my mind, a better number one goal was this: I wanted to help students learn how to judge themselves. Did they recognize their true abilities? Did they have a sense of their own flaws? Were they realistic about how others viewed them? In the end, educators best serve students by helping them be more self-reflective. The only way any of us can improve—as Coach Graham taught me—is if we develop a real ability to assess ourselves. If we can’t accurately do that, how can we tell if we’re getting better or worse?\n\nJune 13, 2017\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInstead, I’d compare college tuition to paying for a personal trainer at an athletic club.\n\nJuly 1, 2015\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe need to make sure that our students are exerting themselves. We need to praise them when they deserve it and to tell them honestly when they have it in them to work harder.\n\nJuly 1, 2015\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA professor’s job is to teach students how to see their minds growing in the same way they can see their muscles grow when they look in a mirror. To that end, I’ve tried hard to come up with mechanical ways to get people to listen to feedback. I was constantly helping my students develop their own feedback loops. It was not easy. Getting people to welcome feedback was the hardest thing I ever had to do as an educator.\n\nJune 13, 2017\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c(It hasn’t been easy in my personal life, either.) It saddens me that so many parents and educators have given up on this. When they talk of building self-esteem, they often resort to empty flattery rather than character-building honesty. I’ve heard so many people talk of a downward spiral in our educational system, and I think one key factor is that there is too much stroking and too little real feedback.\n\nJune 13, 2017\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen I taught the “Building Virtual Worlds” class at Carnegie Mellon, we’d do peer feedback every two weeks. This was a completely collaborative class, with the students working in four-person teams on virtual-reality computer projects. They were dependent on each other, and their grades reflected it. We would take all of the peer feedback and put together a spreadsheet. At the end of the semester, after each student had worked on five projects, with three\n\nJuly 1, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdifferent teammates on each, everyone would have fifteen data points. That was a pragmatic, statistically valid way to look at themselves. I would create multicolored bar charts in which a student could see a ranking on simple measures such as: 1) Did his peers think he was working hard? Exactly how many hours did his peers think he had devoted to a project? 2) How creative was his contribution? 3) Did his peers find it easy or hard to work with him? Was he a team player? As I always pointed out, especially for No. 3, what your peers think is, by definition, an accurate assessment of how easy you are to work with\n\nJuly 1, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe bar charts were coupled with more free-form peer feedback, which was essentially specific suggestions for improvement, such as “Let other people finish their sentences when they’re talking.” My hope was that more than a few students would see this information and say, “Wow, I’ve got to take it up a notch.” It was hard feedback to ignore, but some still managed. For one course I taught, I’d had students assess each other in the same way, but only let them know the quartile in which they ranked. I remember a conversation I had with one student whom others found particularly obnoxious. He was smart, but his healthy sense of himself left him clueless about how he was coming off. He saw the data ranking him in the\n\nJuly 1, 2015\n\u001c89\n\u0011\n\u0011"},{"ty":"te","id":"i.13","spi":4045},{"ty":"te","id":"i.14","spi":4084},{"ty":"te","id":"i.15","spi":4161},{"ty":"te","id":"i.16","spi":4286},{"ty":"te","id":"i.17","spi":4377},{"ty":"te","id":"i.18","spi":4479},{"ty":"te","id":"i.19","spi":5194},{"ty":"te","id":"i.20","spi":5318},{"ty":"te","id":"i.21","spi":5527},{"ty":"te","id":"i.22","spi":5983},{"ty":"te","id":"i.23","spi":6427},{"ty":"te","id":"i.24","spi":6921},{"ty":"te","id":"i.25","spi":7575},{"ty":"te","id":"i.26","spi":7607},{"ty":"as","st":"paragraph","si":4036,"ei":4036,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4037,"ei":4037,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4038,"ei":4038,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4040,"ei":4040,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4042,"ei":4042,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4044,"ei":4044,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":4046,"ei":4046,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_i