s_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunk = [{"ty":"is","ibi":8354,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbottom quartile and remained unfazed. He figured that if he was ranked in the bottom 25 percent, he must have been at the 24 percent or 25 percent level (rather than, say, in the bottom 5 percent). So in his mind, that meant he was almost in the next higher quartile. So he saw himself as “not so far from 50 percent,” which meant peers thought he was just fine. “I’m so glad we had this chat,” I told him, “because I think it’s important that I give you some specific information. You are not just in the bottom 25 percent. Out of fifty students in the class, your peers ranked you dead last. You are number fifty. You have a serious issue. They say you’re not listening. You’re hard to get along with. It’s not going well.” The student was shocked. (They’re always shocked.) He had had all of these rationalizations, and now here I was, giving him hard data.\n\nJuly 1, 2015\n\u001c89\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI used to be just like you,” I said. “I was in denial. But I had a professor who showed he cared about me by smacking the truth into my head. And here’s what makes me special: I listened.” This student’s eyes widened. “I admit it,” I told him. “I’m a recovering jerk. And that gives me the moral authority to tell you that you can be a recovering jerk, too.” For the rest of the semester, this student kept himself in check. He improved. I’d done him a favor, just as Andy van Dam had done for me years before.\n\nJuly 1, 2015\n\u001c90\n\u0011\n\u0011\n\n\n25 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTommy will tell you I was a pretty tough boss. As he now recalls it, I rode him hard and had very high expectations, but he also knew I had his best interests at heart. He compares me to a demanding football coach. (I guess I was channeling Coach Graham.) Tommy also says that he learned not just about virtual reality programming from me, but also about how work colleagues need to be like a family of\n\nJuly 1, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csorts. He remembers me telling him: “I know you’re smart. But everyone here is smart. Smart isn’t enough. The kind of people I want on my research team are those who will help everyone else feel happy to be here.”\n\nJuly 1, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLuck is indeed where preparation meets opportunity\n\nJuly 1, 2015\n\u001c92\n\u0011\n\u0011\n\n\n26 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGuys, that was pretty good, but I know you can do better.’” His answer left me stupefied. But I followed his advice and it turned out to be exactly right. He was telling me I obviously didn’t know how high the bar should be, and I’d only do them a disservice by putting it anywhere. And the students did keep improving, inspiring me with their creations. Many projects were just brilliant, ranging from you-are-there white-water rafting adventures to romantic gondola trips through Venice to rollerskating ninjas. Some of my students created completely unlikely existential worlds populated by lovable 3-D creatures they first dreamed about as kids. On show-and-tell days, I’d come to class and in the room would be my fifty students and another fifty people I didn’t recognize—roommates, friends, parents. I’d never had parents come to class before! And it snowballed from\n\nJuly 1, 2015\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn presentation days, I always knew which projects would be the best. I could tell by the body language. If students in a particular group were standing close together, I knew they had bonded, and that the virtual world they created would be something worth seeing. What I most loved about all of this was that teamwork was so central to its success.\n\nJuly 1, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 1, 2015\n\u001c98\n\u0011\n\u0011\n\n\n27 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow a computer science professor at Washington University in St. Louis, Caitlin (oops, I mean, Dr. Kelleher) is developing new systems that revolutionize how young girls get their first programming experiences. She demonstrated that if it is presented as a storytelling activity, girls become perfectly willing to learn how to write software. In fact, they love it. It’s also worth noting that it in no way turns the\n\nJuly 1, 2015\n\u001c99\n\u0011\n\u0011"},{"ty":"te","id":"i.27","spi":8363},{"ty":"te","id":"i.28","spi":9257},{"ty":"te","id":"i.29","spi":9808},{"ty":"te","id":"i.30","spi":10244},{"ty":"te","id":"i.31","spi":10491},{"ty":"te","id":"i.32","spi":10582},{"ty":"te","id":"i.33","spi":11489},{"ty":"te","id":"i.34","spi":11521},{"ty":"te","id":"i.35","spi":11905},{"ty":"te","id":"i.36","spi":11944},{"ty":"as","st":"paragraph","si":8354,"ei":8354,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8355,"ei":8355,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i