it_i":false,"ts_fs_i":false,"ts_ff_i":false,"ts_fgc":"#000000","ts_fgc_i":true,"ts_it":true,"ts_bd_i":false,"ts_va_i":true,"ts_fs":16.0,"ts_ff":"Droid Serif","ts_bd":false}},{"ty":"as","st":"text","si":11947,"ei":12364,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12365,"ei":12378,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunk = [{"ty":"is","ibi":12385,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cboys off. Everybody loves telling stories. It’s one of the truly universal things about our species. So in my mind, Caitlin wins the All-Time Best Head-Fake Award\n\nJuly 1, 2015\n\u001c99\n\u0011\n\u0011\n\n\n32 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cT OO MANY people go through life complaining about their problems. I’ve always believed that if you took one-tenth the energy you put into complaining and applied it to solving the problem, you’d be surprised by how well things can work out\n\nJuly 1, 2015\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinally, one day I looked through her finances with her. I figured out that if she spent four or five months working a part-time job on Tuesday nights, she could actually pay off all the money she owed. I told her I had nothing against yoga or meditation. But I did think it’s always best to try to treat the disease first. Her symptoms were stress and anxiety. Her disease was the money she owed. “Why don’t you get a job on Tuesday nights and skip yoga for a while?” I suggested. This was something of a revelation to her. And she took my advice. She became a Tuesday-night waitress and soon enough paid off her debts. After that, she could go back to yoga and really breathe easier.\n\nJuly 1, 2015\n\u001c109\n\u0011\n\u0011\n\n\n36 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen it comes to men who are romantically interested in you, it’s really simple. Just ignore everything they say and only pay attention to what\n\nJuly 1, 2015\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthey do.”\n\nJuly 1, 2015\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDance with the one who brung you. That’s a cliché my parents always told me, and it applies far beyond prom night. It should be a mantra in the business world, in academia, and at home. It’s a reminder about loyalty and appreciation. Luck is what happens when preparation meets opportunity. That comes from Seneca, the Roman philosopher who was born in 5 B.C. It’ll be worth repeating for another two thousand years, at least. Whether you think you can or can’t, you’re right. That is from my cliché repertoire for incoming students\n\nJuly 2, 2015\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cE XPERIENCE IS what you get when you didn’t get what you wanted.\n\nJuly 2, 2015\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s a phrase worth considering at every brick wall we encounter, and at every disappointment. It’s also a reminder that failure is not just acceptable, it’s often essential. When I taught the “Building Virtual Worlds” course, I encouraged students to attempt hard things and to not worry about failing. I wanted to reward that way of thinking. So at the end of each semester, I’d present one team of students with a stuffed animal—a penguin. It was called “The First Penguin Award” and went to the team that took the biggest gamble in trying new ideas or new technology, while failing to achieve their stated goals. In essence, it was an award for “glorious failure,” and it celebrated out-of-the-box\n\nJuly 2, 2015\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStart-up companies often prefer to hire a chief executive with a failed start-up in his or her background. The person who failed often knows how to avoid future failures. The person who knows only success can be more oblivious to all the pitfalls. Experience is what you get when you didn’t get what you wanted. And experience is often the most valuable thing you have to offer.\n\nJuly 2, 2015\n\u001c118\n\u0011\n\u0011\n\n\n40 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 2, 2015\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. As they go about creating new technologies, I hope that once in a while I come into their minds, swinging that sledgehammer, reminding them of the frustrated masses, yearning for simplicity.\n\nGrow should be simple to use because the hard part is doing the work and doing the growth and responding to the feedback\n\nJuly 2, 2015\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 3, 2015\n\u001c121\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA lot of people want a shortcut. I find the best shortcut is the long way, which is basically two words: work hard. As I see it, if you work more hours than somebody else, during those hours you learn more about your craft. That can make you more efficient, more able, even happier. Hard work is like compounded interest in the bank. The rewards build faster. The same is true in your life outside of your job. All my adult life I’ve felt drawn to ask long-married couples how they were able to stay together. All of them said the same thing: “We worked hard at it.”\n\nJuly 3, 2015\n\u001c123\n\u0011\n\u0011"},{"ty":"te","id":"i.37","spi":12394},{"ty":"te","id":"i.38","spi":12597},{"ty":"te","id":"i.39","spi":12872},{"ty":"te","id":"i.40","spi":13599},{"ty":"te","id":"i.41","spi":13777},{"ty":"te","id":"i.42","spi":13821},{"ty":"te","id":"i.43","spi":14388},{"ty":"te","id":"i.44","spi":14487},{"ty":"te","id":"i.45","spi":15223},{"ty":"te","id":"i.46","spi":15643},{"ty":"te","id":"i.47","spi":15676},{"ty":"te","id":"i.48","spi":16025},{"ty":"te","id":"i.49","spi":16058},{"ty":"as","st":"paragraph","si":12385,"ei":12385,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12386,"ei":12386,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":12387,"ei":12387,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":12389,"ei":12389,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":12391,"ei":12391,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":12393,"ei":12393,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st"