ementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="JvSzwPTG8gLoeqallmDL523JyzM"  nonce="JvSzwPTG8gLoeqallmDL523JyzM">DOCS_modelChunk = [{"ty":"is","ibi":16650,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 3, 2015\n\u001c123\n\u0011\n\u0011\n\n\n44 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 3, 2015\n\u001c126\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSure, sometimes I had to send a reminder email. But when I’d ping people, all I needed was one sentence: “Did you eat the Thin Mints yet?” I’ve found Thin Mints are a great communication tool. They’re also a sweet reward for a job well done.\n\nJuly 3, 2015\n\u001c126\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA Bad Apology Is Worse Than No Apology A POLOGIES ARE not pass/fail. I always told my students: When giving an apology, any performance lower than an A really doesn’t cut it. Halfhearted or insincere apologies are often worse than not apologizing at all\n\nJuly 3, 2015\n\u001c128\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbecause recipients find them insulting. If you’ve done something wrong in your dealings with another person, it’s as if there’s an infection in your relationship. A good apology is like an antibiotic; a bad apology is like rubbing salt in the wound. Working in groups was crucial in my classes, and friction between students was unavoidable. Some students wouldn’t pull their load. Others were so full of themselves that they’d belittle their partners. By mid-semester, apologies were always in order. When students wouldn’t do it, everything would spin out of control. So I’d often give classes my little routine about apologies. I’d start by describing the two classic bad apologies:\n\nJuly 3, 2015\n\u001c128\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cProper apologies have three parts: 1) What I did was wrong. 2) I feel badly that I hurt you. 3) How do I make this better?\n\nJuly 3, 2015\n\u001c128\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHonesty is not only morally right, it’s also efficient. In a culture where everyone tells the truth, you can save a lot of time double-checking. When I taught at the University of Virginia, I loved the honor code. If a student was sick and needed a makeup exam, I didn’t need to create a new one. The student just “pledged” that he hadn’t talked to anybody about the exam, and I gave the old one. People lie for lots of reasons, often because it seems like a way to get what they want with less effort. But like many short-term strategies, it’s ineffective long-term. You run into people again later, and they remember you lied to them. And they tell lots of other people about it. That’s what amazes me about lying. Most people who have told a lie think they got away\n\nJuly 3, 2015\n\u001c129\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwith it…when in fact, they didn’t.\n\nJuly 3, 2015\n\u001c130\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo many graduating seniors have this notion that they should be hired because of their creative brilliance. Too many are unhappy with the idea of starting at the bottom. My advice has always been: “You ought to be thrilled you got a job in the mailroom. And when you get there, here’s what you do: Be really great at sorting mail.” No one wants to hear someone say: “I’m not good at sorting mail because the job is beneath me.” No job should be beneath us. And if you can’t (or won’t) sort mail, where is the proof that you can do anything?\n\nJuly 4, 2015\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 4, 2015\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen I was fifteen, I worked at an orchard hoeing strawberries, and most of my coworkers were day laborers. A couple of teachers worked there, too, earning a little extra cash for the summer. I made a comment to my dad about the job being beneath those teachers. (I guess I was implying that the job was beneath me, too.) My dad gave me the tongue-lashing of a lifetime. He believed manual labor was beneath no one. He said he’d prefer that I worked hard and became the best ditch-digger in the world rather than coasting along as a self-impressed elitist behind a desk. I went back into that strawberry field and I still didn’t like the job. But I had heard my dad’s words. I watched my attitude and I hoed a little harder.\n\nAnd no course of study is beneath u too. If u gotta start from the fundamentals, do that. U r doing important stuff so u wanna know your shit cold.\n\nJuly 4, 2015\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI should have been telling that story for years, because the moral is: If you want something bad enough, never give up (and take a boost when offered).\n\nJuly 4, 2015\n\u001c137\n\u0011\n\u0011"},{"ty":"te","id":"i.50","spi":16659},{"ty":"te","id":"i.51","spi":16699},{"ty":"te","id":"i.52","spi":16732},{"ty":"te","id":"i.53","spi":17008},{"ty":"te","id":"i.54","spi":17296},{"ty":"te","id":"i.55","spi":18016},{"ty":"te","id":"i.56","spi":18173},{"ty":"te","id":"i.57","spi":18976},{"ty":"te","id":"i.58","spi":19045},{"ty":"te","id":"i.59","spi":19620},{"ty":"te","id":"i.60","spi":19653},{"ty":"te","id":"i.61","spi":20561},{"ty":"as","st":"paragraph","si":16650,"ei":16650,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":16651,"ei":16651,"