 about that. I’ve decided to tell each of my kids things like: “I love the way you tilted back your head when you laughed.” I will give them specific stuff they can grasp.\n\nJuly 4, 2015\n\u001c145\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 4, 2015\n\u001c145\n\u0011\n\u0011\n\n\n59 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 4, 2015\n\u001c150\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJuly 4, 2015\n\u001c153\n\u0011\n\u0011\n\n\n61 …\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s not about how to achieve your dreams. It’s about how to lead your life. If you lead your life the right way, the karma will take care of itself. The dreams will come to you.”\n\nJuly 4, 2015\n\u001c160\n\u0011\n\u0011"}
}'


